// src/components/BotCollection.js
import React from "react";
import BotCard from "./BotCard";

function BotCollection({ bots, onBotClick }) {
  return (
    <div className="ui four column grid">
      <div className="row">
        {bots.length > 0 ? (
          bots.map((bot) => (
            <div className="column" key={bot.id}>
              <BotCard bot={bot} onClick={onBotClick} />
            </div>
          ))
        ) : (
          <div className="column">
            <h3>No bots available</h3>
          </div>
        )}
      </div>
    </div>
  );
}

export default BotCollection;
